import{LoginForm} from "../../../components/Admin"
import "./LoginAdmin.scss";

export  function LoginAdmin() {
  return (
    
    <div className="login-admin" >
      <div className="login-admin__content">
        <h1>Iniciar sesion</h1>
        <LoginForm/> 
        <div className="img">
           <img src="https://images.ctfassets.net/1sv59kqumaqp/2ADoT6m1c84hnTZ2VD4YH/e581bb87c9896c7f953c97cb34b4ee7f/mascotas.png" width="700" alt=""></img>
        </div>
      </div>
    </div>

  );
}
